import { useEffect, useRef } from 'react';
import Chart from 'chart.js/auto';

function ResultPage({ results }) {
  const chartRef = useRef(null);

  useEffect(() => {
    const ctx = chartRef.current.getContext('2d');
    new Chart(ctx, {
      type: 'bar',
      data: {
        labels: ['Correct', 'Incorrect'],
        datasets: [
          {
            label: 'Answers',
            data: [results.correct, results.total - results.correct],
            backgroundColor: ['#28a745', '#dc3545']
          }
        ]
      },
      options: {
        scales: {
          y: { beginAtZero: true }
        }
      }
    });
  }, [results]);

  return (
    <div className="mt-5">
      <h2>Test Results</h2>
      <p>
        Score: {results.correct}/{results.total}
      </p>
      <canvas ref={chartRef} />
      {results.cheatingLog.length > 0 && (
        <div>
          <h3>Cheating Attempts</h3>
          <ul>
            {results.cheatingLog.map((log, idx) => (
              <li key={idx}>
                {log.action} at {log.timestamp}
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default ResultPage;
